import React from 'react'
import Button from "./Button";

class Buttons extends React.Component {
    render() {
        let buttons = this.props.buttons.map( item => <Button name={item.title} onClick={item.callback} /> );
        return (
                {buttons}
        )
    }
}

export default Buttons;
